#include<vector>

using namespace std;

class Solution
{
public:
	long long maxScore(vector<int>& nums, int x)
	{		
		int n = nums.size();
		vector<long long>dp(n);
		dp[0] = nums[0];
		for (int i = 1; i < n; i++) 
		{
			dp[i] = INTMAX_MIN;
		}
		long long Max = INTMAX_MIN;
		for (int i = 0; i < n; i++) 
		{
			long long temp = 0;
			for (int j = i + 1; j < n; j++) 
			{
				temp = dp[i] + nums[j] - x * ((nums[i] + nums[j]) % 2);
				dp[j] = max(dp[j], temp);
				
			}
			Max = max(dp[i], Max);
		}
		return Max;
	}
};

